import React, { useState, useEffect } from 'react';
  
const Test = () => {
    const [count, setCount] = useState(0);
  
    useEffect(() => {
  
        //Implementing the setInterval method
        const interval = setInterval(() => {
            setCount(count + 1);
        }, 1000);
  
        //Clearing the interval
        return () => clearInterval(interval);
    }, );
  
    return <h1>{count}</h1>;
}
  
export default Test;
